import './App.css';

import First from './components/First/First';
import Fourth from './components/Fourth/Fourth';
import Second from './components/Second/Second';

import Third from './components/Third/Third';
import Fifth from './components/Fifth/Fifth';
import Sixth from './components/Sixth/Sixth';
import Seven from './components/Seven/Seven';
import Eight from './components/Eight/Eight';
import Nine from './components/Nine/Nine';
import Ten from './components/Ten/Ten';
import Eleven from './components/Eleven/Eleven';
import Twelve from './components/Twelve/Twelve';
import Thirteen from './components/Thirteen/Thirteen';
import Fourteen from './components/Fourteen/Fourteen';
function App() {
  return (
    <div>
      <First/>
      <Second/>
      <Third/>
      <Fourth/>
      <Fifth />
      <Sixth/>
      <Seven/>
      <Eight/>
      <Nine/>
      <Ten/>
      <Eleven/>
      <Twelve/>
      <Thirteen/>
      <Fourteen/>


    </div>
  );
}

export default App;
